void copy_array(int source[], int dest[], int n) 
{
    for (int i = 0; i < n; i++) 
    {
        dest[i] = source[i];
    }
}

int main(void)
{
    clock_t start, end;
    double total_time_quick = 0, total_time_merge = 0;
    double total_time_selection = 0, total_time_insertion = 0;

    int temp_arr[SIZE];  // Temporary array to preserve original data

    for (int i = 0; i < RUNS; i++) {
        // Quick Sort
        copy_array(arr, temp_arr, SIZE);
        start = clock();
        quick_sort(temp_arr, 0, SIZE - 1);
        end = clock();
        total_time_quick += (double)(end - start) / CLOCKS_PER_SEC;

        // Merge Sort
        copy_array(arr, temp_arr, SIZE);
        start = clock();
        merge_sort(temp_arr, 0, SIZE - 1);
        end = clock();
        total_time_merge += (double)(end - start) / CLOCKS_PER_SEC;

        // Selection Sort
        copy_array(arr, temp_arr, SIZE);
        start = clock();
        selection_sort(temp_arr, SIZE);
        end = clock();
        total_time_selection += (double)(end - start) / CLOCKS_PER_SEC;

        // Insertion Sort
        copy_array(arr, temp_arr, SIZE);
        start = clock();
        insertion_sort(temp_arr, SIZE);
        end = clock();
        total_time_insertion += (double)(end - start) / CLOCKS_PER_SEC;
    }

    // Print the average time for each sorting algorithm
    printf("Average execution time over %d iterations:\n", RUNS);
    printf("Quick Sort: %f seconds\n", total_time_quick / RUNS);
    printf("Merge Sort: %f seconds\n", total_time_merge / RUNS);
    printf("Selection Sort: %f seconds\n", total_time_selection / RUNS);
    printf("Insertion Sort: %f seconds\n", total_time_insertion / RUNS);
    return 0;
}